import React from 'next/react'
import Head from 'next/head'
import App from 'next/App'
import '../src/css/o1.css'

export default class MKtest extends App {
    render() {
        const   {components} = this.props;
        return (
            <div>
                     <components></components>
            </div>
        )
    }
}
